class Solution {
    fun findMinimumOperations(s1: String, s2: String, s3: String): Int {
        // Find the minimum length among the three strings
        val minLength = minOf(s1.length, s2.length, s3.length)

        // Check if prefixes of the strings can be made equal
        for (i in 0 until minLength) {
            if (s1[i] != s2[i] || s2[i] != s3[i]) {
                // If characters are different, check if it's because strings are of different lengths
                // If yes, we can delete characters from longer strings, otherwise return -1
                return if (s1[i] == s2[i] || s2[i] == s3[i] || s1[i] == s3[i]) {
                    // If any two characters are equal, continue checking
                    continue
                } else {
                    // If all three characters are different, it's impossible to make strings equal
                    return -1
                }
            }
        }

        // If we reached here, it means prefixes can be made equal
        // The minimum number of operations is the sum of deletions needed to match the minimum length string
        return (s1.length - minLength) + (s2.length - minLength) + (s3.length - minLength)
    }
}
